package pack2;

public class Default {
	int a;
	String s;
	boolean b;
	float f;
	long l;
	double d;
	char c;
	short sh;
	byte by;
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Default d = new Default();
		System.out.println("int "+d.a);
		System.out.println("string " +d.s);
		System.out.println("boolean "+d.b);
		System.out.println("float "+d.f);
		System.out.println("long "+d.l);
		System.out.println("double "+d.d);
		System.out.println("char "+d.c);
		System.out.println("object " +d);
		System.out.println("short " +d.sh);
		System.out.println("byte " +d.by);
	}

}
